/*Table structure for table `shop` */

DROP TABLE IF EXISTS `shop`;

CREATE TABLE `shop` (
  `shop_id` int NOT NULL AUTO_INCREMENT COMMENT '店铺ID',
  `banner` varchar(1000) DEFAULT NULL COMMENT '店铺首页banner',
  `banner_min` varchar(1000) DEFAULT NULL COMMENT '店铺首页次banner',
  `banner_info` varchar(1000) DEFAULT NULL COMMENT '店铺首页详情商品',
  `attention` int DEFAULT NULL COMMENT '店铺关注人数',
  `bao_money` decimal(10,2) DEFAULT NULL COMMENT '邮费',
  `man_money` decimal(10,2) DEFAULT NULL COMMENT '满免邮费',
  `index_img` varchar(500) DEFAULT NULL COMMENT '店铺活动图片',
  `shop_name` varchar(500) DEFAULT NULL COMMENT '店铺名称',
  `shop_good` int DEFAULT NULL COMMENT '0=好店 1=否',
  `shop_type` int DEFAULT NULL COMMENT '店铺所在平台频道',
  `shop_type_one` int DEFAULT NULL,
  `shop_type_two` int DEFAULT NULL,
  `shop_type_three` int DEFAULT NULL,
  `shop_type_four` int DEFAULT NULL,
  `shop_state` int DEFAULT NULL COMMENT '0=开店 1=闭店',
  `shop_hard` varchar(50) DEFAULT NULL COMMENT '店铺力推商品',
  `shop_img` varchar(500) DEFAULT NULL COMMENT '店铺logo',
  PRIMARY KEY (`shop_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3;

