/*Table structure for table `user_commodity_comment_like` */

DROP TABLE IF EXISTS `user_commodity_comment_like`;

CREATE TABLE `user_commodity_comment_like` (
  `commodity_comment_like_id` int NOT NULL AUTO_INCREMENT COMMENT '商品评论点赞表ID',
  `user_id` int DEFAULT NULL COMMENT '用户ID',
  `type` int DEFAULT NULL COMMENT '类型 0=点赞 1=踩',
  `son_tf` int DEFAULT NULL COMMENT '是否为评论 0是  1不是',
  `tf_id` int DEFAULT NULL COMMENT '评论或者回复ID',
  `send_time` datetime DEFAULT NULL COMMENT '发生时间',
  PRIMARY KEY (`commodity_comment_like_id`)
